import React, { Component } from "react";
import logo from "./images/menu-top.svg";

class Header extends Component {

    render() {
        const headerStyle = {
            position: 'absolute',
            top: '0',
            width: '100%',
            color: '#fff',
            background: '#000',
            height: '50px',
            fontSize: '20px'
        }
        return (
            <header style={headerStyle}>
                <img src={logo} width="100"/>
                <p>heie</p>
            </header>
        );
    }
}

export default Header;
